import { useEffect, useRef } from 'react';
import dice_initialize from './dice/main';

var __html = require('./dice/diceHTML');
var template = { __html: __html };

export default function Dice() {

    const divRef = useRef();


    // <script src="../libs/cannon.min.js"></script>
    // <!--script type="text/javascript" src="https://drive.google.com/uc?id=0ByGeV2TiysmOelhLSnlUQ3ZMc2M"></script>
    // <script type="text/javascript" src="https://drive.google.com/uc?id=0ByGeV2TiysmOczhfWW90OEV0dmM"></script-->


    // <script type="text/javascript" src="../teal.js"></script>
    // <script type="text/javascript" src="dice.js"></script>
    // <script type="text/javascript" src="main.js"></script>
    // <script type="text/javascript" defer="defer">
    //     dice_initialize(document.body);
    // </script>


    useEffect(() => {

        const fragment = document.createRange().createContextualFragment(__html);
        divRef.current.append(fragment);

        const script = document.createElement('script');
        script.src = "../libs/three.min.js";
        script.async = true;
        document.body.appendChild(script);

        const script2 = document.createElement('script');
        script2.src = "../libs/cannon.min.js";
        script2.async = true;
        document.body.appendChild(script2);

        const script3 = document.createElement('script');
        script3.src = "../libs/cannon.min.js";
        script3.async = true;
        document.body.appendChild(script3);


      }, []);

    return (
        <div>
            <div ref={divRef} />
        </div>
    );
  }
